import { useState, useEffect } from 'react';
import axios from "axios";



export default function App() {
  const fetchUsers = () => {
    return fetch('http://localhost:3000/api/v1/users')
        .then(response => console.log(response));
  };

  useEffect(() => {
    fetchUsers();
  }, []);

  return (
    <div>
      <h1>Hello World</h1>
    </div>
  );
}
